import  "./sm.css"

export default function Sm9() {
  return (
    <div >
      <h3 className="title">How to use the power of your subconscious for wealth</h3>
      <ul>
       <li>Repeat for yourself 4-5 times a day - wealth, success. The feeling of wealth produces wealth</li>
        <li>The quickest way for wealth to take wings and fly away is to criticise and condemn others who have more wealth than you</li>
        <li>If you are annoyed or irritated by the prosperity or great wealth of another, claim immediately that you truly wish for him greater wealth in every possible way.</li>
      </ul>
    </div>
  )
  }
